/*******************************************************************************
																	Library of images 
Map128x160 - Map of Game   ////// Top Cactus's are 10 pixels height from 0 to 128, Left Side Cactus is 8 pixels, Right side is 8 pixels, bottom cactus's are 10 pixels
	width = 128
	height = 160
Bunker0 - Small shield floating in space to cover the player's ship from enemy fire(undamaged)
	width = 18
	height = 5
PlayerShip0 - Player's ship
	width = 18
	height = 8
SmallEnemy10point - Enemy
	width = 16
	height = 10
Bullet
	width = 3
	height = 3
LeftEnemy - Left foot forward of enemy
	width = 24
	height = 24
RightEnemy - Right foot forward of enemy
	width = 24
	height = 24
Main_Player -
	width = 24
	height = 24
*****************************************************************************/

struct Character{
	int16_t xpos;    //Where to print on x-coordinate
	int16_t ypos;		// Where to print on y-coordinate
	const uint16_t *images[4];  //WHAT to print
	uint8_t direction; //What direction it is at.
	int16_t health;  //Keep track of health
	uint8_t alive;	//should be alive or not
	uint8_t width;  //how big the image is
	uint8_t height; // ^
};

struct Bullet{
	const uint16_t *image[1];
	int16_t xpos;
	int16_t ypos;
	uint8_t width;  //how big the image is
	uint8_t height; // ^
};
typedef struct Character Character_t;
Character_t Player;
typedef struct Bullet Bullet_t;


void Move_Char(Character_t *character){
	character->xpos += 1;
}
	
void Print_Image(Character_t *character){
	ST7735_DrawBitmap(character->xpos, character->ypos, character->images[character->direction], character->width, character->height);
};
void Print_Bullet(Bullet_t *bullet){
	ST7735_DrawBitmap(bullet->xpos, bullet->ypos, bullet->image[0], bullet->width, bullet->height);
};

void char_init(){ 
	Player.alive = 1;
	Player.direction = 0;
	Player.xpos = 0;
	Player.ypos = 80;
	Player.height = 8;
	Player.width = 18;
	Player.images[0] = PlayerShip0;
}
int main(void){
  PLL_Init(Bus80MHz);       // Bus clock is 80 MHz 
  Random_Init(1);
  Output_Init();						//Initializes screen
	char_init();
	ST7735_DrawBitmap(0,160,Map,128,160);
	ST7735_DrawBitmap(30,60,Bullet,3,3);
	ST7735_DrawBitmap(80, 80,RightEnemy,24,24);
	ST7735_DrawBitmap(40, 40,LeftEnemy,24,24);
	ST7735_DrawBitmap(20, 80,Main_Player,24,24);
  while(1){
		Delay100ms(50);              // delay 5 sec at 80 MHz
  }

}


// You can use this timer only if you learn how it works

void Delay100ms(uint32_t count){uint32_t volatile time;
  while(count>0){
    time = 727240;  // 0.1sec at 80 MHz
    while(time){
	  	time--;
    }
    count--;
  }
}
